import React from 'react'

const Card = ({ flag, name, continent, id }) => {
  return (
    <div>
     <h3>{name}</h3>
     <h5>{continent}</h5>
     <img src={flag} alt="img not found"  width="200px" heigth="250px"/> 
    </div>
  )
}

export default Card
